define({"topics" : [{"title":"About Chart Types","shortdesc":"\n               <p class=\"shortdesc\">The basic types of charts.</p>\n            ","href":"charttypes\/charttype_over.html","attributes": {"data-id":"charttype_over",},"menu": {"hasChildren":false,},"tocID":"charttype_over-d66e6173","topics":[]},{"title":"Task: Column Chart","shortdesc":"\n               <p class=\"shortdesc\">A chart type that is very suitable for displaying time series.</p>\n            ","href":"charttypes\/charttype_column.html","attributes": {"data-id":"charttype_column",},"menu": {"hasChildren":false,},"tocID":"charttype_column-d66e6191","topics":[]},{"title":"Task: Bar Chart","shortdesc":"\n               <p class=\"shortdesc\">Chart type that is very suitable for displaying rankings.</p>\n            ","href":"charttypes\/charttype_bar.html","attributes": {"data-id":"charttype_bar",},"menu": {"hasChildren":false,},"tocID":"charttype_bar-d66e6209","topics":[]},{"title":"Task: Pie Chart","shortdesc":"\n               <p class=\"shortdesc\">A pie chart for showing the percentage distribution within one data series         (group).</p>\n            ","href":"charttypes\/charttype_pie.html","attributes": {"data-id":"charttype_pie",},"menu": {"hasChildren":false,},"tocID":"charttype_pie-d66e6227","topics":[]},{"title":"Task: Line Chart","shortdesc":"\n               <p class=\"shortdesc\">You use a line chart to visualize a trend in data over intervals of time.</p>\n            ","href":"charttypes\/charttype_line.html","attributes": {"data-id":"charttype_line",},"menu": {"hasChildren":false,},"tocID":"charttype_line-d66e6245","topics":[]},{"title":"Task: Scatter (XY) Chart","shortdesc":"\n               <p class=\"shortdesc\">A scatter chart (XY diagram) is very suitable if you want to analyze and show the         relationship between two numeric\n                  variables. It also allows you to determine a trend         line.\n               </p>\n            ","href":"charttypes\/charttype_scatter.html","attributes": {"data-id":"charttype_scatter",},"menu": {"hasChildren":false,},"tocID":"charttype_scatter-d66e6263","topics":[]},{"title":"Line or Scatter Chart?","shortdesc":"\n               <p class=\"shortdesc\">The differences between a line chart and an xy (scatter) chart.</p>\n            ","href":"charttypes\/charttype_line_scatter.html","attributes": {"data-id":"charttype_line_scatter",},"menu": {"hasChildren":false,},"tocID":"charttype_line_scatter-d66e6281","topics":[]},{"title":"Task: Doughnut Chart","shortdesc":"\n               <p class=\"shortdesc\">A doughnut chart can be used if you want to show the percentage distribution of         multiple data series.</p>\n            ","href":"charttypes\/charttype_doughnut.html","attributes": {"data-id":"charttype_doughnut",},"menu": {"hasChildren":false,},"tocID":"charttype_doughnut-d66e6299","topics":[]},{"title":"Task: Area Chart (stacked)","shortdesc":"\n               <p class=\"shortdesc\">You use an area chart to plot multiple data series over a period of time. If the sum         of the values is also important\n                  then use a stacked area chart.\n               </p>\n            ","href":"charttypes\/charttype_area.html","attributes": {"data-id":"charttype_area",},"menu": {"hasChildren":false,},"tocID":"charttype_area-d66e6317","topics":[]},{"title":"Task: Bubble Chart","shortdesc":"\n               <p class=\"shortdesc\">A bubble chart can be used if you want to display the relationship between three         numeric variables.</p>\n            ","href":"charttypes\/charttype_bubble.html","attributes": {"data-id":"charttype_bubble",},"menu": {"hasChildren":false,},"tocID":"charttype_bubble-d66e6335","topics":[]},{"title":"Task: Radar Chart","shortdesc":"\n               <p class=\"shortdesc\">A radar chart (spider chart) can be used if you want to plot multiple categories         among separate axes.</p>\n            ","href":"charttypes\/charttype_radar.html","attributes": {"data-id":"charttype_radar",},"menu": {"hasChildren":false,},"tocID":"charttype_radar-d66e6354","topics":[]},{"title":"Translation chart type names","shortdesc":"\n               <p class=\"shortdesc\">Dutch, English and German names of some chart types.</p>\n            ","href":"charttypes\/charttype_translations.html","attributes": {"data-id":"charttype_translations",},"menu": {"hasChildren":false,},"tocID":"charttype_translations-d66e6372","topics":[]}]});